      const keystroke = getKeystroke(bindings)
      if ((options.title != null) && (keystroke != null)) {
        options.title += ` ${getKeystroke(bindings)}`
      } else if (keystroke != null) {
        options.title = getKeystroke(bindings)
      }
    }

    delete options.selector
