        const tooltipsForTarget = this.tooltips.get(target)
        const index = tooltipsForTarget.indexOf(tooltip)
        if (index !== -1) {
          tooltipsForTarget.splice(index, 1)
        }
        if (tooltipsForTarget.length === 0) {
          this.tooltips.delete(target)
        }
      }
    })

    return disposable
  }

